import React from 'react';

const Navgation = () => {
    return (
        <nav style = {{display: 'flex'}}>
            <p 
            className='f3 link dim black underline pa3 pointer'
            style = {{display: 'flex' , justifyContent: 'flex-end'}}
            >Sign Out</p>
        </nav>
    )
}

export default Navgation;
